(1772, 162, 'контент', '<h4 class=\"title-big\">Программа курса</h4>\r\n<p>\r\n• Материалы и инструменты мастера-бровиста<br>\r\n• Теоретические основы построения брови<br>\r\n• Коррекция формы бровей.<br>\r\n• Колористика<br>\r\n• Система восстановления бровей (отращивание бровей)<br>\r\n• Технология работы с хной<br>\r\n• Работа с краской<br>\r\n• Осветление бровей<br>\r\n• Комбинированное окрашивание<br>\r\n• Работа со сложными бровями<br>\r\n• Создание продающего портфолио.<br>\r\n• Методы привлечения клиентов через интернет и без него<br>\r\n• Отработка на моделях<br><br>\r\n</p>\r\n<img src=\"http://nail-ok.loc/wp-content/uploads/2018/02/course-1.png\" alt=\"\" class=\"alignnone size-full wp-image-174\" />\r\n<div class=\"row-photo\">\r\n<img src=\"http://nail-ok.loc/wp-content/uploads/2018/02/course-2.png\" alt=\"\" class=\"alignnone size-full wp-image-175\" />\r\n<img src=\"http://nail-ok.loc/wp-content/uploads/2018/02/course-3.png\" alt=\"\" width=\"240\" height=\"360\" class=\"alignnone size-full wp-image-176\" />\r\n</div>'),
