(1869, 185, 'инструктор-контент', '<h4>Мила Прямова</h4>\r\n<p>\r\n«Буду очень рада познакомить вас, с миром гелевого моделирования. Показать красоту различных форм и техник работы с гелем.»<br><br>\r\n<b>Образование:</b>\r\nРусская школа красоты «Веллана» — 2005г.\r\n<br><br>\r\n<b>Навыки:</b> гелевое укрепление натуральных ногтей, моделирование ногтей без шаблонов, салонное моделирование геле, гелевое моделирование по формам: Арочный квадрат; Миндаль, Пайп; Стилет, Эдж.\r\n</p>'),
