(2650, 248, 'преимущества_блок-1-текст', 'Идейные соображения высшего\r\nпорядка, а также реализация\r\nнамеченных плановых заданий\r\nпредставляет собой интересный\r\nэксперимент проверки\r\nновых предложений.'),
(2651, 248, '_преимущества_блок-1-текст', 'field_5a86a55a8111c'),
(2652, 248, 'преимущества_блок-2-заголовок', 'Свой учебный центр'),
(2653, 248, '_преимущества_блок-2-заголовок', 'field_5a86a53f62b60'),
(2654, 248, 'преимущества_блок-2-текст', 'Идейные соображения высшего\r\nпорядка, а также реализация\r\nнамеченных плановых заданий\r\nпредставляет собой интересный\r\nэксперимент проверки\r\nновых предложений.'),
(2655, 248, '_преимущества_блок-2-текст', 'field_5a86a586b03f3'),
(2656, 248, 'преимущества_блок-3-заголовок', 'Пять точек продаж'),
(2657, 248, '_преимущества_блок-3-заголовок', 'field_5a86a54a62b61'),
(2658, 248, 'преимущества_блок-3-текст', 'Идейные соображения высшего\r\nпорядка, а также реализация\r\nнамеченных плановых заданий\r\nпредставляет собой интересный\r\nэксперимент проверки\r\nновых предложений.'),
(2659, 248, '_преимущества_блок-3-текст', 'field_5a86a58cb03f4'),
(2660, 248, 'преимущества', ''),
(2661, 248, '_преимущества', 'field_5a86a4e462b5e'),
(2662, 248, 'сео-текст', 'Не следует, однако забывать, что реализация намеченных плановых заданий влечет за собой процессвнедрения и модернизации систем массового участия. Не следует, однако забывать, что рамки и место обучения кадров обеспечивает широкому кругу (специалистов) участие в формировании соответствующий условий активизации. С другой стороны постоянное информационно-пропагандистское обеспечение нашей деятельности представляет собой интересный эксперимент проверки дальнейших направлений развития. Идейные соображения высшего порядка, а также постоянный количественный рост и сфера нашей активности обеспечивает широкому кругу (специалистов) участие в формировании дальнейших направлений развития.<br><br>\r\nПовседневная практика показывает, что постоянный количественный рост и сфера нашей активности позволяет выполнять важные задания по разработке форм развития. Таким образом начало повседневной работы по формированию позиции обеспечивает широкому кругу (специалистов) участие в формировании направлений прогрессивного развития. Значимость этих проблем настолько очевидна, что консультация с широким активом играет важную роль в формировании новых предложений.'),
(2663, 248, '_сео-текст', 'field_5a86a88cf5ac0'),
