(2830, 250, 'преимущества_блок-1-текст', 'Идейные соображения высшего\r\nпорядка, а также реализация\r\nнамеченных плановых заданий\r\nпредставляет собой интересный\r\nэксперимент проверки\r\nновых предложений.'),
(2831, 250, '_преимущества_блок-1-текст', 'field_5a86a55a8111c'),
(2832, 250, 'преимущества_блок-2-заголовок', 'Свой учебный центр'),
(2833, 250, '_преимущества_блок-2-заголовок', 'field_5a86a53f62b60'),
(2834, 250, 'преимущества_блок-2-текст', 'Идейные соображения высшего\r\nпорядка, а также реализация\r\nнамеченных плановых заданий\r\nпредставляет собой интересный\r\nэксперимент проверки\r\nновых предложений.'),
(2835, 250, '_преимущества_блок-2-текст', 'field_5a86a586b03f3'),
(2836, 250, 'преимущества_блок-3-заголовок', 'Пять точек продаж'),
(2837, 250, '_преимущества_блок-3-заголовок', 'field_5a86a54a62b61'),
(2838, 250, 'преимущества_блок-3-текст', 'Идейные соображения высшего\r\nпорядка, а также реализация\r\nнамеченных плановых заданий\r\nпредставляет собой интересный\r\nэксперимент проверки\r\nновых предложений.'),
(2839, 250, '_преимущества_блок-3-текст', 'field_5a86a58cb03f4'),
(2840, 250, 'преимущества', ''),
(2841, 250, '_преимущества', 'field_5a86a4e462b5e'),
(2842, 250, 'сео-текст', 'Не следует, однако забывать, что реализация намеченных плановых заданий влечет за собой процессвнедрения и модернизации систем массового участия. Не следует, однако забывать, что рамки и место обучения кадров обеспечивает широкому кругу (специалистов) участие в формировании соответствующий условий активизации. С другой стороны постоянное информационно-пропагандистское обеспечение нашей деятельности представляет собой интересный эксперимент проверки дальнейших направлений развития. Идейные соображения высшего порядка, а также постоянный количественный рост и сфера нашей активности обеспечивает широкому кругу (специалистов) участие в формировании дальнейших направлений развития.<br><br>\r\nПовседневная практика показывает, что постоянный количественный рост и сфера нашей активности позволяет выполнять важные задания по разработке форм развития. Таким образом начало повседневной работы по формированию позиции обеспечивает широкому кругу (специалистов) участие в формировании направлений прогрессивного развития. Значимость этих проблем настолько очевидна, что консультация с широким активом играет важную роль в формировании новых предложений.'),
