(4981, 370, 'преимущества_блок-1-заголовок', 'С нами выгодно'),
(4982, 370, '_преимущества_блок-1-заголовок', 'field_5a86a51762b5f'),
(4983, 370, 'преимущества_блок-1-текст', 'Идейные соображения высшего\r\nпорядка, а также реализация\r\nнамеченных плановых заданий\r\nпредставляет собой интересный\r\nэксперимент проверки\r\nновых предложений.'),
(4984, 370, '_преимущества_блок-1-текст', 'field_5a86a55a8111c'),
(4985, 370, 'преимущества_блок-2-заголовок', 'Свой учебный центр'),
(4986, 370, '_преимущества_блок-2-заголовок', 'field_5a86a53f62b60'),
(4987, 370, 'преимущества_блок-2-текст', 'Идейные соображения высшего\r\nпорядка, а также реализация\r\nнамеченных плановых заданий\r\nпредставляет собой интересный\r\nэксперимент проверки\r\nновых предложений.'),
(4988, 370, '_преимущества_блок-2-текст', 'field_5a86a586b03f3'),
(4989, 370, 'преимущества_блок-3-заголовок', 'Пять точек продаж'),
(4990, 370, '_преимущества_блок-3-заголовок', 'field_5a86a54a62b61'),
(4991, 370, 'преимущества_блок-3-текст', 'Идейные соображения высшего\r\nпорядка, а также реализация\r\nнамеченных плановых заданий\r\nпредставляет собой интересный\r\nэксперимент проверки\r\nновых предложений.'),
(4992, 370, '_преимущества_блок-3-текст', 'field_5a86a58cb03f4'),
(4993, 370, 'преимущества', ''),
(4994, 370, '_преимущества', 'field_5a86a4e462b5e'),
(4995, 370, 'сео-текст', 'Не следует, однако забывать, что реализация намеченных плановых заданий влечет за собой процессвнедрения и модернизации систем массового участия. Не следует, однако забывать, что рамки и место обучения кадров обеспечивает широкому кругу (специалистов) участие в формировании соответствующий условий активизации. С другой стороны постоянное информационно-пропагандистское обеспечение нашей деятельности представляет собой интересный эксперимент проверки дальнейших направлений развития. Идейные соображения высшего порядка, а также постоянный количественный рост и сфера нашей активности обеспечивает широкому кругу (специалистов) участие в формировании дальнейших направлений развития.<br><br>\r\nПовседневная практика показывает, что постоянный количественный рост и сфера нашей активности позволяет выполнять важные задания по разработке форм развития. Таким образом начало повседневной работы по формированию позиции обеспечивает широкому кругу (специалистов) участие в формировании направлений прогрессивного развития. Значимость этих проблем настолько очевидна, что консультация с широким активом играет важную роль в формировании новых предложений.'),
