(1134, 1, '2018-03-23 00:08:56', '2018-03-22 21:08:56', 'Повседневная практика показывает, что постоянный количественный рост и сфера нашей активности позволяет выполнять важные задания по разработке форм развития. Таким образом начало повседневной работы по формированию позиции обеспечивает широкому кругу (специалистов) участие в формировании направлений прогрессивного развития. Значимость этих проблем настолько очевидна, что консультация с широким активом играет важную роль в формировании новых предложений.', 'Товар-1', '', 'publish', 'open', 'closed', '', '%d1%82%d0%be%d0%b2%d0%b0%d1%80-1', '', '', '2018-03-23 00:08:57', '2018-03-22 21:08:57', '', 0, 'http://nail-ok.loc/product/import-placeholder-for-%d1%82%d0%be%d0%b2-1/', 0, 'product', '', 0),
